    const [ password, setPassword ] = useState('');
    const [ isLogin, setIsLogin ] = useState(false);

   
    function handleChange(name, value) {
        switch(name) {
            case 'username':
                setUsername(value);
                console.log(value);
                break;
            case 'password':
            
                setPassword(value);
                console.log(value);
                break;
            default: 
            console.log('no hay valores')
        }
    }

    return(
        <div className='container'>
            <h1>Login</h1> 
            <label>Usuario: </label>
            <br/>
            <input type= "text"  name="username" handleChange={handleChange} />
            <br/>
            <label>Password: </label>
            <br/>
            <input type= "text" name="password" handleChange={handleChange}/>
            <br/>
            <button text='Log In'>Log in  </button>
           
        </div>
    );

}

export default Login;
